  <style>
    .clear {
    clear: both
}

.nopadding {
    padding: 0
}

.nomargin {
    margin: 0
}

.bold {
    font-weight: 700
}

a, a:hover {
    text-decoration: none;
}

.des {
    line-height: 1.5
}

body {
    margin: 0;
    padding: 0
}

.container {
    width: 1200px;
    padding: 0 15px
}

.check-side .check-custom {
    display: block;
    position: relative;
    padding-left: 28px;
    margin-bottom: 12px;
    cursor: pointer;
    font-size: 13px;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    line-height: 20px;
    color: #666;
    font-family: "Inter", ".SFNSDisplay", "SFProDisplay-Regular", "SFUIDisplay-Regular", ".SFUIDisplay", "-apple-system", "BlinkMacSystemFont", ".SFNSDisplay-Medium", "SFProDisplay-Medium", "SFUIDisplay-Medium", ".SFUIDisplay-Medium", "SF Pro Display", "-apple-system", "BlinkMacSystemFont", sans-serif;
    font-weight: 400
}

.check-side .check-custom .count-item {
    color: #999
}

.check-side .check-custom input {
    position: absolute;
    opacity: 0
}

.check-side .checkmark {
    position: absolute;
    top: 3px;
    left: 6px;
    height: 12px;
    width: 12px;
    background-color: #fff;
    -webkit-box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    border: 1px solid #666;
    border-radius: 3px
}

.check-side .check-custom:hover input ~ .checkmark {
    background-color: #fff;
    -webkit-box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    border: 1px solid #666;
    border-radius: 3px
}

.check-side .check-custom input:checked ~ .checkmark {
    background-color: #fff;
    -webkit-box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    box-shadow: 0 0 3px 1px rgba(0, 0, 0, .1);
    border: 1px solid #666;
    border-radius: 3px
}

.check-side .checkmark:after {
    content: "";
    position: absolute;
    display: none
}

.check-side .check-custom input:checked ~ .checkmark:after {
    display: block
}

.check-side .check-custom .checkmark:after {
    left: 4px;
    top: -3px;
    width: 6px;
    height: 10px;
    border: solid #666;
    border-width: 0 2px 2px 0;
    -webkit-transform: rotate(45deg);
    -ms-transform: rotate(45deg);
    transform: rotate(45deg)
}

.check-side .check-custom a {
    color: #002dd6
}

.sidebar .box-item .check-side {
    display: inline-block;
    width: 100%
}

.sidebar .box-item ul {
    padding-left: 20px
}

.sidebar .box-item li:last-child .check-custom {
    margin-bottom: 0 !important
}

.sidebar .box-item li .check-custom {
    margin-bottom: 15px !important
}

.box-item .check-side > .check-custom:last-child {
    margin-bottom: 0
}

.navigation {
    padding: 10px 0 10px 0;
    display: inline-block;
    width: 100%;
    float: left;
    background-color: #fff;
}

.navigation ul {
    display: flex;
}

.navigation ul li,
.navigation ul li a:hover {
    color: #2367FF;
}

.navigation ul li {
    display: inline-flex;
    font: 14px 'sf pro display', sans-serif;
}

.navigation ul li:not(:last-child) {
    margin-right: 5px;
}

.navigation ul li svg {
    margin-left: 5px;
}

.navigation ul li a {
    color: #3B4859;
}

.anima-hvr {
    position: relative;
    display: block;
    overflow: hidden
}

.anima-hvr:after, .anima-hvr:before {
    position: absolute;
    content: "";
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    transition: all .5s ease-in-out
}

.anima-hvr:hover:after, .anima-hvr:hover:before {
    background-color: rgba(255, 255, 255, .5)
}

.anima-hvr:hover:before {
    right: 50%;
    left: 50%
}

.anima-hvr:hover:after {
    top: 50%;
    bottom: 50%
}
