<script type="text/javascript">
    jQuery(document).ready(function() {
    	setTimeout(function(){
            var height = $(".group_fixed").height();
            $(".site-container").css("margin-top", height);
        }, 500);
        $(document).on("click", ".cls-btn-product-to-cart",function () {
            var cart = $('.cart');
            var imgtofly = $(this).parents('div.item-product-custom').find('.box-img a img').eq(0);
            if (imgtofly) {
                var imgclone = imgtofly.clone()
                    .offset({ top:imgtofly.offset().top, left:imgtofly.offset().left })
                    .css({'opacity':'0.7', 'position':'absolute', 'height':'150px', 'width':'150px', 'z-index':'1000'})
                    .appendTo($('body'))
                    .animate({
                        'top':cart.offset().top + 10,
                        'left':cart.offset().left + 30,
                        'width':55,
                        'height':55
                    }, 1000, 'linear');
                imgclone.animate({'width':0, 'height':0}, function(){ $(this).detach() });
            }

            // set total quantity
            let totalQuantity = parseInt($("#totalQuantityCart").val());
            let totalQuantityLast = 1 + totalQuantity;

            // add to cart
            let id              = $(this).attr("data-id");
            let qty = 1;
            let image          = $(this).attr("data-image");
            let name           = $(this).attr("data-name");
            let price_market   = $(this).attr("data-price_market");
            let url            = $(this).attr("data-url");
            let sku            = $(this).attr("data-sku");
            let kg             = $(this).attr("data-kg");
            let text_qt        = $(this).attr("data-text_qt");
            let images_qt      = $(this).attr("data-images_qt");

            let data = {
                "id":  parseInt(id),
                "sl":  qty,
                "image":  image,
                "name": name,
                "price_market":  price_market,
                "url":  url,
                "sku":  sku,
                "kg":  kg,
                "text_qt":  text_qt,
                "images_qt":  images_qt
            };

            $.ajax({
                url: "https://japana.vn/frontend/cart/addcart",
                type: "POST",
                data: data,
                cache: false,
                dataType: "html",
                success: function(result)
                {
                    $("#totalQuantityCart").val(totalQuantityLast);
                    $(".count-giohang").html(totalQuantityLast);
                }
            });
            return false;
        });

    });
</script>

