<script>
    $('.add-to-cart').on('click', function () {
        var cart = $('.cart');
        var imgtodrag = $(this).parent('.item').find("img").eq(0);
        if (imgtodrag) {
            var imgclone = imgtodrag.clone()
                .offset({
                top: imgtodrag.offset().top,
                left: imgtodrag.offset().left
            })
                .css({
                'opacity': '0.5',
                    'position': 'absolute',
                    'height': '150px',
                    'width': '150px',
                    'z-index': '100'
            })
                .appendTo($('body'))
                .animate({
                'top': cart.offset().top + 10,
                    'left': cart.offset().left + 10,
                    'width': 75,
                    'height': 75
            }, 1000, 'easeInOutExpo');
            
            setTimeout(function () {
                cart.effect("shake", {
                    times: 2
                }, 200);
            }, 1500);

            imgclone.animate({
                'width': 0,
                    'height': 0
            }, function () {
                $(this).detach()
            });
        }
    });
</script>



<script>

    function codepromotion()
    {
    	var item = new Object();
    	item.code = $("#coupon").val();
    	if($.trim(item.code) == ''){
    	    return false;
        }
    	$.ajax({
    		url: "/frontend/cart/codepromotion",
    		type: "POST",
    		data: item,
    		dataType: "html",
    		cache: false,
    		success: function(result)
    		{
    			if(result != "-1"){
    				$("#giamgia").append("<p>Giảm giá("+item.code+"): <span>- "+number_format(result)+" đ</span></p>");
    			}else{
    				alert("mã không phù hợp hoặc đã được sử dụng");
    			}
        	}
        });
    }
    function login()
    {
    	var item = new Object();
    	item.password = $("#password-login").val();
    	item.username = $("#username-login").val();
    	$.ajax({
    		url: "https://japana.vn/frontend/user/login",
    		type: "POST",
    		data: item,
    		dataType: "html",
    		cache: false,
    		success: function(result)
    		{
				if(result == "-1"){
					$("#error-login").text("Số điện thoại/Email hoặc mật khẩu không chính xác");
				}else if(result == "1"){
					$("#error-login").text("Số điện thoại/Email hoặc mật khẩu không được để trống");
				}else{
    				window.location.reload(true);
				}
        	}
        });
    }
    function register_frontend(){
        var name = jQuery("#name");
        var email = jQuery("#email");
        var tel = jQuery("#mobile");
        var pass = jQuery('#password');
        var repass = jQuery('#re_password');

        var flag = 0;
        if(!name.val()){
            name.css("border","1px solid red");
            name.focus();
            name.addClass('alert');
            name.attr('placeholder', 'Bạn chưa nhập họ tên');
            flag = 1;
        }
        else{
            name.css("border","1px solid #ccc");
        }
        if(!tel.val()){

            tel.css("border","1px solid red");
            if(flag == 0){
                tel.focus();
            }
            
            tel.addClass('alert');
            tel.attr('placeholder', 'Bạn chưa nhập số điện thoại');
            flag = 1;
        }
